import React from "react";
const Navbar = async () => {
  const response = await fetch(
    `https://api.themoviedb.org/3/trending/all/week?api_key=c08925b0a10a9ed2a65bf9f938d20719&language=en-US`
  );
  const data = await response.json();
  return (
    <div>
      {data.map((data) => (
        <img
          src={`https://image.tmdb.org/t/p/original${data.backdrop_path}`}
          width="100%"
          height="400px"
        />
      ))}
    </div>
  );
  console.log(data);
};

export default Navbar;
